import React from "react";
import styled, {ThemeProvider} from "styled-components";
import PageWrapper from "../components/PageWrapper";
import blueTriangle from "../misc/images/tr_3.png";
import StyledTriangle from "../components/Triangles";
import rootTheme from "../themes/root";
import Project from "../components/Project";
import Arrow from "../components/Arrow";
import arrowSrc from "../misc/images/right-arrow 1.svg.svg";
import PWLogo from "../misc/images/PW.png";

const MyWorkPageWrapper = styled(PageWrapper)`
    display: flex;
    flex-flow: column;
`;

const TextWrapper = styled.section`
    font-size: ${props => props.theme.fontSize.xlarge}vw;
    font-weight: bold;
    justify-self: center;
    align-self: center;
    margin-bottom: 5vh;
`;

const ProjectsWrapper = styled.section`
    display: flex;
    justify-content: space-around;
    align-items: center;
    position: relative;
`;

const ArrowRight = styled(Arrow)`
    width: 10vw;
    height: 10vh;
`;

const ArrowLeft = styled(ArrowRight)`
    transform: rotate(180deg);
`;

const MyWorkPage = () => {
    return (
        <ThemeProvider theme={rootTheme}>
            <MyWorkPageWrapper>
                <StyledTriangle as="img" src={blueTriangle} alt="blue" />
                <TextWrapper>Here you can find my projects</TextWrapper>
                <ProjectsWrapper>
                    <ArrowLeft as="img" src={arrowSrc} alt="arrow" />
                    <Project technologies={"Study C++"} href={"https://github.com/Kalin8900/Studies/tree/master/zad_7"} logo={PWLogo}/>
                    <ArrowRight as="img" src={arrowSrc} alt="arrow" />
                </ProjectsWrapper>
            </MyWorkPageWrapper>
        </ThemeProvider>
    )
}

export {MyWorkPage};
